import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">SnapdealClone</div>
      <input
        type="text"
        className="navbar-search"
        placeholder="Search products..."
      />
      <div className="navbar-icons">
        <span>Cart</span>
        <span>Login</span>
      </div>
    </nav>
  );
};

export default Navbar;
